import React from 'react'
import apple from "../images/Group 68.svg";
import google from "../images/Group 69.svg";
import '../Styles/Sect.css'

const Sect = () => {
  return (
    <div className='sect-row'>
        <div>

        </div>

        <button>Get Started</button>
        <div>
            <img src={apple} alt="" />
            <img src={google} alt="" />
        </div>
    </div>
  )
}

export default Sect
